selector_to_html = {"a[href=\"lbm_data.html#array-terminology\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.1. </span>Array Terminology<a class=\"headerlink\" href=\"#array-terminology\" title=\"Permalink to this heading\">#</a></h2><p>Light-beads microscopy is a 2-photon imaging paradigm based on <a class=\"reference external\" href=\"https://docs.scanimage.org/index.html\">ScanImage</a> acquisition software.</p>", "a[href=\"lbm_data.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1. </span>Light Beads Microscopy Data<a class=\"headerlink\" href=\"#light-beads-microscopy-data\" title=\"Permalink to this heading\">#</a></h1><p>Current Light Beads Microscopy (LBM) data is aquired with ScanImage aquisition software.</p><p>ScanImage <a class=\"reference external\" href=\"https://docs.scanimage.org/Premium+Features/Multiple+Region+of+Interest+(MROI).html\">Multi Region Of Interest (mROI)</a> outputs raw <code class=\"docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> files made up of individual <code class=\"docutils literal notranslate\"><span class=\"pre\">Regions</span> <span class=\"pre\">of</span> <span class=\"pre\">Interest</span> <span class=\"pre\">(ROI's)</span></code>.</p>", "a[href=\"#guides\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Guides<a class=\"headerlink\" href=\"#guides\" title=\"Permalink to this heading\">#</a></h1><p>Guides for users analyzing microscopy data.</p>", "a[href=\"lbm_data.html#frame-ordering\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.2. </span>Frame Ordering<a class=\"headerlink\" href=\"#frame-ordering\" title=\"Permalink to this heading\">#</a></h2><p>ScanImage saves raw tiffs with each z-depth and timepoint interleaved [zT]:</p>", "a[href=\"lbm_data.html#lbm-metadata\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.3. </span>LBM Metadata<a class=\"headerlink\" href=\"#lbm-metadata\" title=\"Permalink to this heading\">#</a></h2><p>The primary distinction between Light-Beads Microscopy datasets and standard 2p datasets are how the data is organized on disk.</p><p>This information is stored in the <a class=\"reference external\" href=\"https://docs.scanimage.org/Appendix/ScanImage%2BBigTiff%2BSpecification.html#scanimage-bigtiff-specification\">ScanImage Metadata</a>.</p>", "a[href=\"mbo_servers.html#connecting-with-rdp\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.1. </span>Connecting with RDP<a class=\"headerlink\" href=\"#connecting-with-rdp\" title=\"Permalink to this heading\">#</a></h2><p>Unlike a personal desktop, MBO servers will not be accessible from any computer on the Rockefeller network.</p><p>Access to MBO severs are is via Microsoft Remote Desktop Protocol (RDP).</p>", "a[href=\"mbo_servers.html#filesystem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2. </span>Filesystem<a class=\"headerlink\" href=\"#filesystem\" title=\"Permalink to this heading\">#</a></h2><p>The <code class=\"docutils literal notranslate\"><span class=\"pre\">D:</span></code> drive is <strong>read-only</strong> and contains:</p>", "a[href=\"mbo_servers.html#ssh-connections\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.4. </span>SSH Connections<a class=\"headerlink\" href=\"#ssh-connections\" title=\"Permalink to this heading\">#</a></h2><p><a class=\"reference external\" href=\"https://learn.microsoft.com/en-us/windows/terminal/tutorials/ssh\"><code class=\"docutils literal notranslate\"><span class=\"pre\">ssh</span></code></a> is a communication protocol that will allow you to access MBO servers from the command line.<br/>\nYou may want ssh access to install personal software, transfer files, or navigate the Windows filesystem.</p><p>To establish a connection, the computer you are connecting from (the \u2018client\u2019) must have a private ssh key.</p>", "a[href=\"mbo_servers.html#software\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.3. </span>Software<a class=\"headerlink\" href=\"#software\" title=\"Permalink to this heading\">#</a></h2><h3><span class=\"section-number\">2.3.1. </span><code class=\"docutils literal notranslate\"><span class=\"pre\">conda</span></code> (miniforge3)<a class=\"headerlink\" href=\"#conda-miniforge3\" title=\"Permalink to this heading\">#</a></h3><p>Each user account has its own <code class=\"docutils literal notranslate\"><span class=\"pre\">Miniforge3</span></code> flavored <code class=\"docutils literal notranslate\"><span class=\"pre\">conda</span></code> installation at <code class=\"docutils literal notranslate\"><span class=\"pre\">C:/Users/miniforge3</span></code>.</p><p>This is your environment to install and reinstall as you please.</p>", "a[href=\"mbo_servers.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2. </span>Server Guide<a class=\"headerlink\" href=\"#server-guide\" title=\"Permalink to this heading\">#</a></h1><p>As a user of MBO servers you will be given a login and a password to a Windows Server 2022 desktop.</p><p>This login will give you access to all of the resources of that server, shared with a limited number of other users.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
